const renderToDom = (pets) => {
  let domString = '';
  for(pet of pets) {
    domString += `<div id="petCards" class="card" style="width: 18rem;">
    <img src=${pet.imageUrl} class="car-img-top">
    <a href="#" class="btn btn-primary">Take me home!</a>
    <div class="name"></div>
    <h5 class="name">${pet.name}</h5>
    <p class="info">${pet.type} <br> ${pet.color} <br> ${pet.specialSkill}</p>
    <p><button class="btn btn-danger" id="delete--${pet.id}" id="idTwo">!!!Delete!!!</button></p>
    </div>`

  }
    
    const app = document.querySelector("#app")
    app.innerHTML = domString
}

renderToDom(pets)

 const dinoButton = document.querySelector("#dino")
 const dogButton = document.querySelector("#dog")
 const catButton = document.querySelector("#cat")
 const allButton = document.querySelector("#all")


const filter = (type) => {
let allPetsArray = []
  for(pet of pets) {
    if(pet.type === type) {
      allPetsArray.push(pet)
   } 
  } 
  renderToDom(allPetsArray)
} 
dinoButton.addEventListener("click", () => {
filter ("dino");
})
dogButton.addEventListener("click", () => {
filter ("dog");
})
catButton.addEventListener("click", () => {
filter ("cat");
})
allButton.addEventListener("click", () => {
renderToDom(pets);
})






 const form = document.querySelector("form")

const createPet = (event) => {
event.preventDefault()

  const newPet = {
       id: pets.length + 1,
       name: document.querySelector('#newPetName').value,
       color: document.querySelector('#newPetColor').value,
       type: document.querySelector('#newPetType').value,
       specialSkill: document.querySelector('#newPetSS').value,
       imageUrl: document.querySelector('#newPetPic').value
  }
  pets.push(newPet)
  renderToDom(pets)
  form.reset()
}

 form.addEventListener('submit', createPet)


 app.addEventListener('click', (e) => {
  if (e.target.id.includes("delete")) {
    const [, id] = e.target.id.split("--");
    const index = pets.findIndex(e => e.id === Number(id));
    pets.splice(index, 1);
    renderToDom(pets);
  }
});
const startApp = () => {
  renderToDom(pets);
}


startApp();
